// \u89E3\u6784chidldren
function Lister({ children }){
    return <div>\u8FD9\u662F\u4E00\u4E2A\u7EC4\u4EF6{children}</div>
}

class App extends React.Component{
    render()  {
        return(
            <Lister>\u8FD9\u662F\u4F20\u7684children\u5B50\u8282\u70B9</Lister>
        )
    }
}

export default App
