`,paraId:299,tocIndex:49},{value:"React \u4F7F\u7528 store",paraId:300,tocIndex:49},{value:"\u5B9E\u73B0\u6B65\u9AA4:",paraId:301,tocIndex:49},{value:"\u5728\u7EC4\u4EF6\u4E2D\u5BFC\u5165 counterStore \u5B9E\u4F8B\u5BF9\u8C61",paraId:302,tocIndex:49},{value:"\u5728\u7EC4\u4EF6\u4E2D\u4F7F\u7528 storeStore \u5B9E\u4F8B\u5BF9\u8C61\u4E2D\u7684\u6570\u636E",paraId:302,tocIndex:49},{value:"\u901A\u8FC7\u4E8B\u4EF6\u8C03\u7528\u4FEE\u6539\u6570\u636E\u7684\u65B9\u6CD5\u4FEE\u6539 store \u4E2D\u7684\u6570\u636E",paraId:302,tocIndex:49},{value:"\u8BA9\u7EC4\u4EF6\u54CD\u5E94\u6570\u636E\u53D8\u5316",paraId:302,tocIndex:49},{value:`// \u5BFC\u5165counterStore
